import React, { Component } from "react";

export default class Login extends Component {
	render() {
		return (
			<div className="login">
				<div class="container">
					<form className="login">
						<h1>Log in</h1>
						<label for="username">Username</label>
						<input type="text" placeholder="username"></input>
					</form>
				</div>
			</div>
		);
	}
}
